import React, { Component } from 'react'

export class AddEventBtn extends Component {

    render() {
        return (
            <div className="addEventBtn">
                <div
                    style={{ textDecoration: 'none', color: 'black' }}
                    onClick={this.props.hideMe}
                    to="/add-an-event">
                    Add an event!
                </div>
            </div>
        )
    }
}

export default AddEventBtn
